import React from 'react'
import './Mist.css'

export default class mist extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    return(
    <div className="mistContainer">
    <div className="mist" />
    <div className="mist" />
    <div className="mist" />
    <div className="mist" />
    <div className="mist" />
    <div className="mist" />
    <div className="mist" />
    <div className="mist" />
    <div className="mist" />
    <div className="mist" />
    <div className="mist" />
  </div>
  )
  }
}
